import {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor(){
    super();

    this.state = {
      monsters: [{name: "ajay"}, {name: "vijay"}, {name: "sujay"}]
    }
  }

  render(){
    return (
      <div className="App">

        this.state.monsters.map(x => {
          <h1>x.name</h1>
        })

      </div>
    );
  }

}

export default App;
